import gitHubIcon from "../../images/icons8-github-32.png";
import linkedInIcon from "../../images/icons8-linkedin-30.png";
import xIcon from "../../images/icons8-twitterx-50.png";

import htmlIcon from "../../images/htmlIcon.svg";
import cssIcon from "../../images/cssIcon.svg";
import scssIcon from "../../images/scss.36794a5c6ae023d462dd42371652f3d9.svg";
import reactIcon from "../../images/react.4a6a8eddc67552babf7475946fbb1975.svg";
import javaScriptIcon from "../../images/javascript.b4bd9f55e7a5e07fef75c3ec6c6113b7.svg";
import corelIcon from "../../images/corel.dba8753774927cb5a6c20e71fbac319c.svg";
import tailwindCssIcon from "../../images/tailwind-css.d84a6f369e7170891c4a19587ccf78e1.svg";
import mongoDbIcon from "../../images/mongodb.ec5b2fbd7dbe9cce6b93be1b3ad2ea6c.svg";
import gitIcon from "../../images/git.9e5efe4a58d251d445603088a1667119.svg";
import nextJsIcon from "../../images/next-js.43e649734b4f278577629a3488272d9f.svg";
import nodeJsIcon from "../../images/nodejs.dbfe5f95c0bc757a67be277698b93cce.svg";
// import framerMotionIcon from "../../images/"

type myTechDetail = {
	imgSrc: string;
	content: string;
};

const brandingDetails: myTechDetail[] = [
	{
		imgSrc: htmlIcon,
		content: "Html",
	},
	{
		imgSrc: cssIcon,
		content: "Css",
	},
	{
		imgSrc: scssIcon,
		content: "Scss",
	},
	{
		imgSrc: javaScriptIcon,
		content: "JavaScript",
	},
	{
		imgSrc: reactIcon,
		content: "React.js",
	},
	{
		imgSrc: corelIcon,
		content: "Corel",
	},
	{
		imgSrc: tailwindCssIcon,
		content: "TailwindCss",
	},
	{
		imgSrc: gitIcon,
		content: "Git",
	},
	{
		imgSrc: nextJsIcon,
		content: "Next.js",
	},
	{
		imgSrc: nodeJsIcon,
		content: "Node.js",
	},
	{
		imgSrc: mongoDbIcon,
		content: "Mongo Db",
	},
];

const myTech: [] = [];

const About = () => {
	return (
		<div className=" h-[82vh] flex flex-col gap-5 p-10 relative px-28">
			<div>
				<span className="font-semibold">Tech Personality:</span> I'm passionate
				about Technology and I love creating amazing websites/web Apps with good
				and wonderful User Experience. I have a dynamic and progressive
				personality, I'm open to learning as much as practically possible to
				increase my skill level and I'm forever open to work with good Team of
				developers all over the world in order to make a positive impact on the
				world.
			</div>
			<div>
				<span className="font-semibold">Hobbies:</span> Aside from writing
				codes, I also enjoy graphic designing, I'm a football lover and I just
				don't watch it, I play it. Before I forget I love music and just like
				football I listen, I sing and I play Piano too.
			</div>
			<div>
				<span className="font-semibold">Interests:</span> I have interest in
				Technology, Music, Sports and a little in politics.
			</div>
			<div>
				<span className="font-semibold">Soft Skills:</span> I'm organized,
				creative, reliable, motivated, professional, a fast learner, a team
				player, a time manager, a problem solver and goal oriented.
			</div>
			<div>
				<span className="font-semibold">Technologies I use:</span>
				<div className="flex flex-wrap gap-10 mt-4">
					<div className="shadow-md px-4 py-2 rounded-sm">Html 5</div>
					<div className="shadow-md px-4 py-2 rounded-sm">Css 3</div>
					<div className="shadow-md px-4 py-2 rounded-sm">TailwindCss</div>
					<div className="shadow-md px-4 py-2 rounded-sm">Scss</div>
					<div className="shadow-md px-4 py-2 rounded-sm">
						Animate on scroll
					</div>
					<div className="shadow-md px-4 py-2 rounded-sm"> JavaScript</div>
					<div className="shadow-md px-4 py-2 rounded-sm">React.js</div>
					<div className="shadow-md px-4 py-2 rounded-sm">Node.js</div>
					<div className="shadow-md px-4 py-2 rounded-sm">React Redux</div>
					<div className="shadow-md px-4 py-2 rounded-sm">MongoDb</div>
					<div className="shadow-md px-4 py-2 rounded-sm">Git</div>
					<div className="shadow-md px-4 py-2 rounded-sm">Next.js</div>
					<div className="shadow-md px-4 py-2 rounded-sm">TypeScript</div>
					<div className="shadow-md px-4 py-2 rounded-sm">Photoshop CC</div>
					<div className="shadow-md px-4 py-2 rounded-sm">Framer Motion</div>
				</div>
			</div>
			<div className="absolute top-56 left-10 flex flex-col gap-8">
				<img
					src={linkedInIcon}
					alt=""
					width={25}
					className="cursor-pointer"
					title="LinkedIn"
				/>
				<img
					src={gitHubIcon}
					alt=""
					width={25}
					className="cursor-pointer"
					title="Github"
				/>
				<img
					src={xIcon}
					alt=""
					width={23}
					className="cursor-pointer"
					title="X"
				/>
			</div>
		</div>
	);
};

export default About;
